import React, { useContext, useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import { AuthContext } from "../context/AuthContext";  
import "../styles/Profile.css";
import "../styles/Home.css"; // Import Home.css for dashboards styling

// ... your imports remain the same

function Profile() {
  const navigate = useNavigate();
  const { user, logout } = useContext(AuthContext);

  const firstName = user.full_name.split(" ")[0];
  const formattedFirstName = firstName.charAt(0).toUpperCase() + firstName.slice(1);

  const [stockData, setStockData] = useState({
    symbol: "AAPL",
    price: "--",
    change: "--",
    changePercent: "--",
  });

  const [currencyData, setCurrencyData] = useState({
    base: "EUR",
    rates: { USD: "--", GBP: "--", PKR: "--" },
  });

  // ✅ Dynamic users list
  const [users, setUsers] = useState([
    { id: 1, name: user.full_name, status: "Active" },
  ]);

  useEffect(() => {
    Promise.all([
      fetch("http://127.0.0.1:5000/api/stock").then((res) => res.json()),
      fetch("http://127.0.0.1:5000/api/currency").then((res) => res.json()),
    ])
      .then(([stockRes, currencyRes]) => {
        if (stockRes) setStockData(stockRes);

        if (currencyRes && currencyRes.rates) {
          setCurrencyData({
            base: currencyRes.base,
            rates: {
              USD: currencyRes.rates.USD,
              GBP: currencyRes.rates.GBP,
              PKR: currencyRes.rates.PKR,
            },
          });
        }
      })
      .catch((err) => console.error("Error fetching data:", err));
  }, []);

  // ✅ Inactivity tracking
  useEffect(() => {
    let timeout;
    const setActive = () => {
      setUsers([{ id: 1, name: user.full_name, status: "Active" }]);
      clearTimeout(timeout);
      timeout = setTimeout(() => {
        setUsers([{ id: 1, name: user.full_name, status: "Idle" }]);
      }, 5 * 60 * 1000); // 5 minutes
    };

    window.addEventListener("mousemove", setActive);
    window.addEventListener("keydown", setActive);

    setActive(); // initialize as Active

    return () => {
      window.removeEventListener("mousemove", setActive);
      window.removeEventListener("keydown", setActive);
      clearTimeout(timeout);
    };
  }, [user.full_name]);

  if (!user) {
    navigate("/login");
    return null;
  }

  const handleLogout = () => {
    logout();
    navigate("/login");
  };

  return (
    <div className="profile-page">
      {/* ... other sections unchanged ... */}

      {/* User Activity Table */}
      <div className="table-container">
        <div className="card">
          <h2>User Activity</h2>
          <table className="user-table">
            <thead>
              <tr>
                <th>Name</th>
                <th>Status</th>
              </tr>
            </thead>
            <tbody>
              {users.map((u) => (
                <tr key={u.id}>
                  <td>{u.name}</td>
                  <td className={`status ${u.status.toLowerCase()}`}>
                    {u.status}
                  </td>
                </tr>
              ))}
            </tbody>
          </table>

          {/* Keep Application Load & Stress as is */}
          <h2 className="table-margin-top">Application Load & Stress</h2>
          <table className="user-table">
            <thead>
              <tr>
                <th>Total Users</th>
                <th>Active Users</th>
                <th>Load</th>
                <th>Stress (%)</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td>--</td>
                <td>--</td>
                <td>--</td>
                <td>--</td>
              </tr>
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
}

export default Profile;
